{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/thccao/bellabeat-company-case-study?scriptVersionId=141826502\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"40dda6fd","metadata":{"papermill":{"duration":0.031883,"end_time":"2023-09-03T15:13:27.096064","exception":false,"start_time":"2023-09-03T15:13:27.064181","status":"completed"},"tags":[]},"source":["# **How Can a Wellness Technology Company Play It Smart?**"]},{"attachments":{"91adab3a-c614-45fc-abad-c0e95073f97a.png":{"image/png":""}},"cell_type":"markdown","id":"c51f3f90","metadata":{"papermill":{"duration":0.02825,"end_time":"2023-09-03T15:13:27.151747","exception":false,"start_time":"2023-09-03T15:13:27.123497","status":"completed"},"tags":[]},"source":["![download.png](attachment:91adab3a-c614-45fc-abad-c0e95073f97a.png)"]},{"cell_type":"markdown","id":"ad5b1524","metadata":{"papermill":{"duration":0.028879,"end_time":"2023-09-03T15:13:27.208085","exception":false,"start_time":"2023-09-03T15:13:27.179206","status":"completed"},"tags":[]},"source":["# Table of contents:\n","\n","[I. Summary](#1)\n","\n","[II. Ask](#2)\n","\n","[III. Prepare](#3)\n","\n","[IV. Process](#4)\n","\n","[V. Analyze and Share](#5)\n","\n","[VI. Act (Recommendations)](#6)"]},{"cell_type":"markdown","id":"76be00c5","metadata":{"papermill":{"duration":0.028007,"end_time":"2023-09-03T15:13:27.26698","exception":false,"start_time":"2023-09-03T15:13:27.238973","status":"completed"},"tags":[]},"source":["\n","<a id=\"1\"></a> <br>\n","# I. Summary\n","\n","**About the company**: \n","\n","Bellabeat is a tech company founded by Urška Sršen and Sando Mur in 2013, which produces smart products for women's health. The company has experienced rapid growth and has become a leading tech-driven wellness company for women, offering products that collect data on activity, sleep, stress, and reproductive health.\n","\n","**Scenario**:\n","\n","You are a junior data analyst working on the marketing analytics team at Bellabeat. You have been asked to focus on one of their products and analyze smart device fitness data as Urška Sršen, the co-founder and Chief Creative Officer of Bellabeat, believes that analyzing smart device data can unlock new growth opportunities for the company. The analysis will help you gain insights into how consumers are using smart devices, which will be used as a guide for the company's marketing strategies. \n","\n","The product that will be focused on in this project is Bellabeat app. This is an app designed to offer users with health data regarding their activity, sleep, stress levels, menstrual cycle, and mindfulness habits. By providing users with such information, the app enables them to gain a better understanding of their current health habits and make informed decisions regarding their well-being. Bellabeat app is compatible with the company's line of smart wellness products."]},{"cell_type":"markdown","id":"aa877c99","metadata":{"papermill":{"duration":0.027489,"end_time":"2023-09-03T15:13:27.322556","exception":false,"start_time":"2023-09-03T15:13:27.295067","status":"completed"},"tags":[]},"source":["<a id=\"2\"></a> <br>\n","# II. Ask\n","\n","**1. Business task**: \n","\n","Our task is to analyze smart device usage data to gain insight into how consumers use non-Bellabeat smart\n","devices. The insight will then be applied to make recommendations for the marketing strategy of Bellabeat app. To guide our analysis, we should consider three main questions:\n","\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n","\n","**2. Key stakeholders**: \n","\n","- Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","- Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","- Bellabeat marketing analytics team"]},{"cell_type":"markdown","id":"4d455e1f","metadata":{"papermill":{"duration":0.028195,"end_time":"2023-09-03T15:13:27.378115","exception":false,"start_time":"2023-09-03T15:13:27.34992","status":"completed"},"tags":[]},"source":["<a id=\"3\"></a> <br>\n","# III. Prepare\n","**1. Data set information:**\n","Sršen encourages you to use public data that explores smart device users’ daily habits. She points you to a specific data set: FitBit Fitness Tracker Data, posted by Mobius on Kaggle and was last updated 2 years ago. The data was collected through Amazon Mechanical Turk from 12th March 2016 to 12th May 2016. The data was contributed by 30 Fitbit users who agreed to share their personal tracker data, which includes minute-level physical activity, heart rate, and sleep monitoring.\n","\n","**2. Data sources description:**\n","The data set consists of 18 CSV files, containing various information about smart device users. The table below describes the data contained in each file:\n","\n","| Table Name | Type | Description |\n","| --- | --- | --- |\n","| dailyActivity_merged | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories |\n","|dailyCalories_merged | Microsoft Excel CSV | Daily Calories burned over 31  days of 33 users |\n","| dailyIntensities_merged | Microsoft Excel CSV | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged | Microsoft Excel CSV | Daily Steps over 31 days of 33 users | \n","| heartrate_seconds_merged | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users |\n","| hourlyCalories_merged | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users |\n","| hourlyIntensities_merged | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users |\n","| hourlySteps_merged | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users |\n","| minuteCaloriesNarrow_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users |\n","| minuteCaloriesWide_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users |\n","| minuteIntensitiesNarrow_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users |\n","| minuteIntensitiesWide_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users |\n","| minuteMETsNarrow_merged | Microsoft Excel CSV | Ratio of the energy you are using in a physical activity compared to the energy you would use at rest. Counted in minutes |\n","| minuteSleep_merged | Microsoft Excel CSV | Log Sleep by Minute for 24 users over 31 days |\n","| minuteStepsNarrow_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users |\n","| minuteStepsWide_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users |\n","| sleepDay_merged | Microsoft Excel CSV| Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n","| weightLogInfo_merged | Microsoft Excel CSV | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI.5 users report weight manually 3 users not.In total there are 8 users |\n","\n","**Determining the credibility of data:**\n","The data set satisfies most of ROCCC, which are 5 criteria to assess whether data is good or bad according to the Google Data Analytics course (Reliable, Original, Comprehensive, Current and Cited). \n","- Reliable: The data was generated by FitBit users and collected via Amazon Mechanical Turk, a reputable platform for data collection. However, the sample of this data set is only 33, which may not be enough to be representative of the population and may lead to bias.\n","- Original: The data was collected directly from the FitBit devices used by the participants.\n","- Comprehensive: The data contains a lot of information needed to analyze and find insights about smart device wearers.\n","- Current: The data set was collected between 03.12.2016-05.12.2016, which means it is more than 6 years old and is not so new anymore.\n","- Cited: The source of the data and information about its authors are provided.\n","\n","To sum up, although the data set is not new and its sample is not very large, it comes from reliable sources and can provide many useful information for the analysis of device users habits.\n"]},{"cell_type":"markdown","id":"70fbaade","metadata":{"papermill":{"duration":0.028481,"end_time":"2023-09-03T15:13:27.436065","exception":false,"start_time":"2023-09-03T15:13:27.407584","status":"completed"},"tags":[]},"source":["<a id=\"4\"></a> <br>\n","# IV. Process:\n","\n","In this step we will import, clean and transform data to make it ready to be analyzed.\n","\n","**1. Installing necessary packages**\n"]},{"cell_type":"code","execution_count":1,"id":"225ffc33","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:27.49816Z","iopub.status.busy":"2023-09-03T15:13:27.495481Z","iopub.status.idle":"2023-09-03T15:13:28.768748Z","shell.execute_reply":"2023-09-03T15:13:28.767061Z"},"papermill":{"duration":1.306549,"end_time":"2023-09-03T15:13:28.771142","exception":false,"start_time":"2023-09-03T15:13:27.464593","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n","here() starts at /kaggle/working\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]}],"source":["library(tidyverse) \n","library(here) \n","library(skimr) \n","library(janitor) \n","library(dplyr) \n","library(lubridate) \n","library(ggplot2) \n","library(readr) "]},{"cell_type":"markdown","id":"4aac9325","metadata":{"papermill":{"duration":0.029144,"end_time":"2023-09-03T15:13:28.829225","exception":false,"start_time":"2023-09-03T15:13:28.800081","status":"completed"},"tags":[]},"source":["**2. Importing data sets**\n","\n","In this case study, we will focus on three files:\n","- daily_Activity\n","- hourly_Intensity\n","- sleep_Day"]},{"cell_type":"code","execution_count":2,"id":"0f595764","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:28.926773Z","iopub.status.busy":"2023-09-03T15:13:28.887306Z","iopub.status.idle":"2023-09-03T15:13:29.371543Z","shell.execute_reply":"2023-09-03T15:13:29.369768Z"},"papermill":{"duration":0.515968,"end_time":"2023-09-03T15:13:29.373996","exception":false,"start_time":"2023-09-03T15:13:28.858028","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m940\u00