ep. Hence, in this project, it would be more appropriate to analyze the relationship between a person's health habits and the time it takes them to fall asleep instead. This duration can be calculated by subtracting the total minutes asleep from the total time in bed. To do this, we will add a new column titled \"time_to_fall_asleep\" in the merged dataset."]},{"cell_type":"code","execution_count":12,"id":"20891919","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:31.242627Z","iopub.status.busy":"2023-09-03T15:13:31.240937Z","iopub.status.idle":"2023-09-03T15:13:31.280247Z","shell.execute_reply":"2023-09-03T15:13:31.278717Z"},"papermill":{"duration":0.074596,"end_time":"2023-09-03T15:13:31.283404","exception":false,"start_time":"2023-09-03T15:13:31.208808","status":"completed"},"tags":[]},"outputs":[],"source":["daily_activity_sleep <- daily_activity_sleep %>% \n","  mutate(time_to_fall_asleep = total_time_in_bed - total_minutes_asleep) "]},{"cell_type":"code","execution_count":13,"id":"9f9f9612","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:31.347969Z","iopub.status.busy":"2023-09-03T15:13:31.346409Z","iopub.status.idle":"2023-09-03T15:13:31.391949Z","shell.execute_reply":"2023-09-03T15:13:31.389621Z"},"papermill":{"duration":0.081228,"end_time":"2023-09-03T15:13:31.394925","exception":false,"start_time":"2023-09-03T15:13:31.313697","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 19</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>id</th><th scope=col>date</th><th scope=col>total_steps</th><th scope=col>total_distance</th><th scope=col>tracker_distance</th><th scope=col>logged_activities_distance</th><th scope=col>very_active_distance</th><th scope=col>moderately_active_distance</th><th scope=col>light_active_distance</th><th scope=col>sedentary_active_distance</th><th scope=col>very_active_minutes</th><th scope=col>fairly_active_minutes</th><th sc