tice many issues related to the health habits of smart device users:\n","\n","- Users walk 8,515 steps/day on average, which can be considered \"somewhat active\" (Tudor-Locke & Bassett, 2004). However, this needs to be increased, as the CDC recommends people to aim for at least 10,000 steps a day for general health (Huizen, 2021).\n","\n","- The average sedentary time is around 712 minutes/day, which needs to be reduced.\n","\n","- On average, a user sleeps 419 minutes/day, which is slightly under the recommended 7 hours a day by the CDC for adults.\n","\n","- The average time for users to fall asleep is 39.31 minutes, but according to Summer (2022), a healthy person falls asleep within 15 to 20 minutes of lying down. This shows that many of them have difficulty falling asleep.\n","\n","- The average fairly active minutes is 17.92. This seems not to be enough because 150-300 minutes/week, which is equal to at least 21.4 minutes/day, is what is recommended by the U.S. Department of Health and Human Services (Robb, 2022).\""]},{"cell_type":"markdown","id":"bbca32bf","metadata":{"papermill":{"duration":0.031473,"end_time":"2023-09-03T15:13:31.78067","exception":false,"start_time":"2023-09-03T15:13:31.749197","status":"completed"},"tags":[]},"source":["**2. Correlation**\n","\n","Next, it is necessary to discover the relationship between variables. In this case study, we will determine the relationships between:\n","- Total steps and calories burned\n","- Total steps and time to fall asleep\n","- Calories burned and time to fall asleep\n","- Each of the 4 types of active minutes and time to fall asleep\n","\n","**a. Total steps and calories burned**"]},{"cell_type":"code","execution_count":16,"id":"f90ffd7e","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:31.847198Z","iopub.status.busy":"2023-09-03T15:13:31.845393Z","iopub.status.idle":"2023-09-03T15:13:33.781576Z","shell.execute_reply":"2023-09-03T15:13:33.779935Z"},"papermill":{"duration":1.973749,"e