heir sleep quality.\n","\n","**3. Trends in daily activity and health habits of users**\n","\n","**a. Classifying people by active levels**\n","\n","We will categorize users based on the number of steps taken a day to see what percentage of smart device users each group account for. Classification is made based on Tudor' research (cited in Bumgardner, 2020):\n","\n","- Sedentary: Less than 5,000 steps/day\n","- Low Active: 5,000 to 7,499 steps/day\n","- Somewhat Active: 7,500 to 9,999 steps/day\n","- Active: 10,000 to 12,500 steps/day\n","- Very Active: More than 12,500 steps/day\n","\n","First, we need to calculate each users' average number of steps per day:"]},{"cell_type":"code","execution_count":21,"id":"269c4ddb","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:35.558697Z","iopub.status.busy":"2023-09-03T15:13:35.556979Z","iopub.status.idle":"2023-09-03T15:13:35.582236Z","shell.execute_reply":"2023-09-03T15:13:35.580409Z"},"papermill":{"duration":0.071022,"end_time":"2023-09-03T15:13:35.584987","exception":false,"start_time":"2023-09-03T15:13:35.513965","status":"completed"},"tags":[]},"outputs":[],"source":["average_step <- daily_activity_sleep %>% \n","\n","  group_by(id) %>% \n","\n","  summarise(avgsteps = mean(total_steps)) "]},{"cell_type":"code","execution_count":22,"id":"c3651b51","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:35.669003Z","iopub.status.busy":"2023-09-03T15:13:35.667298Z","iopub.status.idle":"2023-09-03T15:13:35.690588Z","shell.execute_reply":"2023-09-03T15:13:35.688853Z"},"papermill":{"duration":0.066864,"end_time":"2023-09-03T15:13:35.692871","exception":false,"start_time":"2023-09-03T15:13:35.626007","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>id</th><th scope=col>avgsteps</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<t