"tags":[]},"outputs":[],"source":["average_step <- average_step %>% \n","\n","  mutate(classification = case_when( \n","\n","    avgsteps < 5000 ~ \"Sedentary\", \n","\n","    avgsteps >= 5000 & avgsteps < 7500 ~ \"Low Active\", \n","\n","    avgsteps >= 7500 & avgsteps < 10000 ~ \"Somewhat Active\", \n","\n","    avgsteps >= 10000 & avgsteps <= 12500 ~ \"Active\", \n","\n","    avgsteps > 12500 ~ \"Very Active\" \n","\n","  )) "]},{"cell_type":"markdown","id":"073459fc","metadata":{"papermill":{"duration":0.03819,"end_time":"2023-09-03T15:13:35.991737","exception":false,"start_time":"2023-09-03T15:13:35.953547","status":"completed"},"tags":[]},"source":["Next, we calculate the percentage each group accounts for"]},{"cell_type":"code","execution_count":24,"id":"c844f07f","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:36.074275Z","iopub.status.busy":"2023-09-03T15:13:36.072559Z","iopub.status.idle":"2023-09-03T15:13:36.095619Z","shell.execute_reply":"2023-09-03T15:13:36.093821Z"},"papermill":{"duration":0.067112,"end_time":"2023-09-03T15:13:36.098032","exception":false,"start_time":"2023-09-03T15:13:36.03092","status":"completed"},"tags":[]},"outputs":[],"source":["classification_percent <- average_step %>% \n","\n","  group_by(classification) %>% \n","\n","  summarise(Count = n()) %>% \n","\n","  mutate(Percentage = round(Count/sum(Count)*100, 2)) "]},{"cell_type":"markdown","id":"60eff8ff","metadata":{"papermill":{"duration":0.042404,"end_time":"2023-09-03T15:13:36.181998","exception":false,"start_time":"2023-09-03T15:13:36.139594","status":"completed"},"tags":[]},"source":["The order level of groups needs to be set"]},{"cell_type":"code","execution_count":25,"id":"88ca8831","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:36.265772Z","iopub.status.busy":"2023-09-03T15:13:36.2641Z","iopub.status.idle":"2023-09-03T15:13:36.279476Z","shell.execute_reply":"2023-09-03T15:13:36.27786Z"},"papermill":{"duration":0.059486,"end_time":"2023-09-03T15:13:36.281788","exception":false,"start_time":"2023-09-03T15:13:36.222302","status":"completed"},"tags":[]},"outputs":[],"source":["order_levels <- c(\"Sedentary\", \"Low Active\", \"Somewhat Active\", \"Active\", \"Very Active\") \n","\n","classification_percent$classification <- factor(classification_percent$classification, levels = order_levels) "]},{"cell_type":"markdown","id":"e2976269","metadata":{"papermill":{"duration":0.04103,"end_time":"2023-09-03T15:13:36.362619","exception":false,"start_time":"2023-09-03T15:13:36.321589","status":"completed"},"tags":[]},"source":["Finally, we create a pie chart to demonstrate the distribution of users types based on average steps"]},{"cell_type":"code","execution_count":26,"id":"bf9d6691","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:36.446933Z","iopub.status.busy":"2023-09-03T15:13:36.445205Z","iopub.status.idle":"2023-09-03T15:13:36.470755Z","shell.execute_reply":"2023-09-03T15:13:36.468947Z"},"papermill":{"duration":0.069627,"end_time":"2023-09-03T15:13:36.473162","exception":false,"start_time":"2023-09-03T15:13:36.403535","status":"completed"},"tags":[]},"outputs":[],"source":["pie_chart <- ggplot(classification_percent, aes(x = \"\", y = Percentage, fill = classification)) + \n","\n","  geom_bar(stat = \"identity\", width = 1) + \n","\n","  coord_polar(\"y\", start = 0) + \n","\n","  ggtitle(\"Distribution of User Types\") + \n","\n","  theme_void() + \n","\n","  geom_text(aes(label = paste0(Percentage, \"%\")), position = position_stack(vjust = 0.5), size = 4) + \n","  \n","  theme(plot.title = element_text(hjust = 0.5, face = \"bold\"))"]},{"cell_type":"code","execution_count":27,"id":"d78cb524","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:36.556177Z","iopub.status.busy":"2023-09-03T15:13:36.554599Z","iopub.status.idle":"2023-09-03T15:13:36.961008Z","shell.execute_reply":"2023-09-03T15:13:36.959181Z"},"papermill":{"duration":0.450056,"end_time":"2023-09-03T15:13:36.96