east calories. Bellabeat app may want to sends more workout reminders on this day. \n","\n","**4. Trends in time users wear devices**\n","\n","As Bellabeat app is connected with Bellabeat wealness watch, finding ways to make people more engaged with the tracker can help the company increase as well as retain app users. We will now discover some trends and patterns in terms of the time people use smart devices. The time an user wear the tracker in a day is calculated by the total of minutes recorded. \n","\n","**a. Distribution of wearing times**\n","\n","Before drawing the graph, we need to calculate the average wearing time of each users and group them by user ID.  "]},{"cell_type":"code","execution_count":39,"id":"33edfbfc","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:40.451172Z","iopub.status.busy":"2023-09-03T15:13:40.449622Z","iopub.status.idle":"2023-09-03T15:13:40.494735Z","shell.execute_reply":"2023-09-03T15:13:40.492654Z"},"papermill":{"duration":0.091999,"end_time":"2023-09-03T15:13:40.49708","exception":false,"start_time":"2023-09-03T15:13:40.405081","status":"completed"},"tags":[]},"outputs":[],"source":["avg_wearing_time <- daily_activity %>% \n","\n","  mutate(time_worn = very_active_minutes + fairly_active_minutes + lightly_active_minutes + sedentary_minutes) %>% \n","\n","  group_by(id) %>% \n","\n","  summarise(avg_time_worn = mean(time_worn))"]},{"cell_type":"markdown","id":"46e64e27","metadata":{"papermill":{"duration":0.042448,"end_time":"2023-09-03T15:13:40.582283","exception":false,"start_time":"2023-09-03T15:13:40.539835","status":"completed"},"tags":[]},"source":["We can now visualize the wearing time distribution"]},{"cell_type":"code","execution_count":40,"id":"27f2b1bc","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:40.672624Z","iopub.status.busy":"2023-09-03T15:13:40.671041Z","iopub.status.idle":"2023-09-03T15:13:40.909807Z","shell.execute_reply":"2023-09-03T15:13:40.908059Z"},"papermill":{"duration":