 more than 1,380 minutes (23 hours) a day. As they have the tendency to wear the device almost all day, they may look for features such as long battery life or comfortable straps when choosing trackers. Focus on these features and promoting them can attract more customers, which lead to more app users. \n","\n","Besides,as the analysis shows that users wear the device for the majority of the day, Bellabeat may want to emphasize the device's ability to track daily activity and provide personalized insights for a healthy lifestyle. This means that they may want to focus their marketing efforts on highlighting the device's ability to track steps, calories burned, and other metrics throughout the day. They could also emphasize the device's ability to provide personalized insights and recommendations based on the user's data, which can help users adopt healthier habits and reach their fitness goals.\n","\n","**b. Average wearing time over the period**\n","\n","Let's see how the average time users wear the tracker change over time."]},{"cell_type":"code","execution_count":41,"id":"c6f73637","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:13:41.090378Z","iopub.status.busy":"2023-09-03T15:13:41.088894Z","iopub.status.idle":"2023-09-03T15:13:41.36849Z","shell.execute_reply":"2023-09-03T15:13:41.366566Z"},"papermill":{"duration":0.326598,"end_time":"2023-09-03T15:13:41.371124","exception":false,"start_time":"2023-09-03T15:13:41.044526","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUxd8H8O9su5oKAULvCRAIXZAqRSkWVFCxomLnr9gLj7037L1hQ+yK0qQI\nShGlQ4BACL0YSM/1Lc+LxRhDbnNJ7i53l9/nFWwmM3Obnd3fzU5hmqaBEEIIIYREP66+K0AI\nIYQQQoKDAjtCCCGEkBhBgR0hhBBCSIygwI4QQgghJEZQYEcIIYQQEiMosCOEEEIIiREU2BFC\nCCGExAgK7AghhBBCYkTDCuw01dHZKjHGOF5aV+ar7+o0dOvv78kYG7viSAMsPVrQWSKEkOjS\nsAK7/K337Xb5AGiq757v9tV3dUj4aKpj1apVa9cdrO+KRDQ6S4QQEu2E+q5AWC2/6wcAzce1\nPzI/d8PDH+HKp+q7Rg1a20mPz0